import React from "react";

function Footer() {
  return (
    <div className="footer relative block">
      <footer className="py-5 bg-gray-900">
          <p className="m-0 text-center text-white">
            Copyright &copy; Daniel Bello
          </p>
      </footer>
    </div>
  );
}

export default Footer;
